import React from 'react';

//Style

import logo from '../../assets/imagens/logo_japaratinga.png';
import trator from '../../assets/imagens/imagem_trator.png';
import './BuildingStyle.css';

const BuildingView = (props) => {
    let menu = ['Início', 'Administração', 'Notícias', 'Projetos']

    return(

        <div
            style={{
                height: '100vh',
                backgroundImage: `url(${trator})`,
                backgroundRepeat: 'no-repeat',
                backgroundSize: 'contain',
                backgroundPosition: 'right center'

            }}
        >

            <div

            >
                <img src={logo} style={{marginRight: '60px', marginLeft: '45px', marginTop: '30px'}} />

                {
                    menu.map(item=>{
                        console.log(item);
                        return(
                            <a
                                href='#'
                                style={{

                                    fontFamily: 'Roboto',
                                    fontStyle: 'normal',
                                    fontWeight: 'normal',
                                    fontSize: '14px',
                                    lineHeight: '16px',
                                    marginRight: '30px',
                                    marginTop: '50px',

                                    color: '#52B848',

                                }}
                            >
                                {item}
                            </a>
                        )
                    })
                }

            </div>

            <div
                style={{
                    margin: '20px',
                }}

            >
                <div
                    style={{
                        position: 'absolute',
                        width: '414px',
                        height: '84px',
                        left: '50px',
                        top: '257px',

                        fontFamily: 'Suez One',
                        fontStyle: 'normal',
                        fontWeight: 'normal',
                        fontSize: '62px',
                        lineHeight: '84px',
                        color: '#52B848',

                    }}
                >
                    Bem Vindo (a)
                </div>

                <div
                    style={{
                        position: 'absolute',
                        width: '537px',
                        height: '76px',
                        left: '55px',
                        top: '333px',

                        fontFamily: 'Suez One',
                        fontStyle: 'normal',
                        fontWeight: 'normal',
                        fontSize: '24px',
                        lineHeight: '31px',
                        color: '#52B848',

                    }}
                >
                    Infelizmente o site está em <br/> desenvolvimento
                </div>

                <div
                    style={{
                        position: 'absolute',
                        width: '315px',
                        height: '24px',
                        left: '49px',
                        top: '409px',

                        fontFamily: 'Suez One',
                        fontStyle: 'normal',
                        fontWeight: 'normal',
                        fontSize: '18px',
                        lineHeight: '24px',
                        color: '#52B848',
                        marginLeft: '8px'

                    }}
                >
                    Mas logo logo estaremos de volta :D

                </div>

            </div>



        </div>

    )

};

export default BuildingView;
